function RawData = Read_Rawdata(Subname)Baseline_Filename = [Subname '_baseline.CSV'];RawData.baseline = csvread(Baseline_Filename);RawData.baseline_FPA = RawData.baseline(2251:6000,21);RawData.baseline_FPA_unique = unique(RawData.baseline_FPA,'stable');RawData.Mean_baseline_FPA = mean(RawData.baseline_FPA_unique);RawData.Std_baseline_FPA  = std(RawData.baseline_FPA_unique);RawData.length_baseline_FPA = length(RawData.baseline_FPA_unique);RawData.SEM_baseline_FPA = RawData.Std_baseline_FPA/sqrt(RawData.length_baseline_FPA);Toe_in_Filename = [Subname '_toe_in.CSV'];RawData.Toe_in = csvread(Toe_in_Filename);RawData.Toe_in_FPA = RawData.Toe_in(2251:6000,21);RawData.Toe_in_FPA_unique = unique(RawData.Toe_in_FPA,'stable');RawData.Mean_Toe_in_FPA = mean(RawData.Toe_in_FPA_unique);RawData.Std_Toe_in_FPA  = std(RawData.Toe_in_FPA_unique);RawData.length_Toe_in_FPA = length(RawData.Toe_in_FPA_unique);RawData.SEM_Toe_in_FPA = RawData.Std_Toe_in_FPA/sqrt(RawData.length_Toe_in_FPA);Toe_out_Filename = [Subname '_toe_out.CSV'];RawData.Toe_out = csvread(Toe_out_Filename);RawData.Toe_out_FPA = RawData.Toe_out(2251:6000,21);RawData.Toe_out_FPA_unique = unique(RawData.Toe_out_FPA,'stable');RawData.Mean_Toe_out_FPA = mean(RawData.Toe_out_FPA_unique);RawData.Std_Toe_out_FPA  = std(RawData.Toe_out_FPA_unique);RawData.length_Toe_out_FPA = length(RawData.Toe_out_FPA_unique);RawData.SEM_Toe_out_FPA = RawData.Std_Toe_out_FPA/sqrt(RawData.length_Toe_out_FPA);